import React, { useEffect } from 'react';
import './LevelPage.css';

const LevelPage = () => {
  useEffect(() => {
    // Запуск анимации через 1 секунду после загрузки страницы
    const header = document.querySelector('.level-header');
    setTimeout(() => {
      header.classList.add('animate-down');
    }, 1000);
  }, []);

  return (
    <div className="level-home">
      <header className="level-header">
        <div className="level-stars"></div>
        <h1>Level Header</h1>
      </header>
      <main className="level-main">
        <p>Content of the page</p>
      </main>
    </div>
  );
};

export default LevelPage;
